CLamAV versions 0.103+ provide CMake build tooling. In 0.103, this is for experimental and development purposes only. Autotools should be used for production builds. In 0.104+, CMake is the only build system. Autotools and Visual Studio build systems have been removed. The following will help you get started, but for FULL details on how to use CMake to build ClamAV, see the INSTALL.md file located in the clamav repository. Ninja Build is recommended when doing development work. Builds using Ninja are significantly faster, both on Unix and Windows systems. The following instructions assume you have installed CMake, Ninja, and either GCC, Clang, or Visual Studio 2015 or newer. Linux/Unix cmake .. -G Ninja \ -D CMAKE_BUILD_TYPE="Debug" \ -D OPTIMIZE=OFF \ -D CMAKE_INSTALL_PREFIX=install \ -D ENABLE_MILTER=ON \ -D ENABLE_EXAMPLES=ON \ -D ENABLE_STATIC_LIB=ON \ -D ENABLE_SYSTEMD=OFF \ && ninja && ninja install Windows vcpkg can be used to build the ClamAV library dependencies automatically. See the vcpkg README for installation instructions. Once installed, set the variable $VCPKG_PATH to the location where you installed vcpkg: $VCPKG_PATH="..." # Path to your vcpkg installation By default, CMake and vcpkg build for 32-bit. If you want to build for 64-bit, set the VCPKG_DEFAULT_TRIPLET environment variable: $env:VCPKG_DEFAULT_TRIPLET="x64-windows" Now run the following to build ClamAV's library dependencies: & "$VCPKG_PATH\vcpkg" install 'curl[openssl]' 'json-c' 'libxml2' 'pcre2' 'pthreads' 'zlib' 'pdcurses' 'bzip2' 'check' Finally, you can use the following to build ClamAV using Ninja for super fast builds. Replace "2019" and "Community" with different versions or editions as needed to match your Visual Studio installation. Configure (generate the build system): pushd "C:\Program Files (x86)\Microsoft Visual Studio\2019\Community\Common7\Tools"
cmd /c "VsDevCmd.bat -arch=amd64 & set" |
foreach { if ($_ -match "=") { $v = $_.split("="); set-item -force -path "ENV:\$($v[0])" -value "$($v[1])" }
}
popd
Write-Host "`nVisual Studio 2019 Command Prompt variables set." -ForegroundColor Yellow cmake .. -G Ninja ` -D CMAKE_BUILD_TYPE="Debug" ` -D CMAKE_TOOLCHAIN_FILE="$VCPKG_PATH\scripts\buildsystems\vcpkg.cmake" ` -D CMAKE_INSTALL_PREFIX="install" Build: ninja Install (to the CMAKE_INSTALL_PREFIX directory): ninja install Tip : I like to place the "Configure" script in a configure.ps1 script file in my home directory. This way I can simply run ~\configure.ps1 followed by ninja to do a build. Testing with CTest ClamAV version 0.104+ will include unit tests, integration tests, & feature tests performed via CMake's ctest toolset. All tests are executed within through ctest but within a Python test framework build around Python's unittest module. See clamav/unit_tests/testcase.py. Python 3.5+ is required. Note : Valgrind tests are performed on Linux if Valgrind is installed. Unit Tests The libclamav unit tests use the libcheck framework. There are presently no unit tests for libfreshclam. See clamav/unit_tests/check_clamav.c for the libclamav unit tests. Integration Tests ClamAV is presently light on integration tests for libclamav, though you may think of the application feature as integration tests, because the apps integrate libclamav. Tests for additional features not easily exercised via the existing applications could be added by creating new example applications in clamav/examples and exercising those programs in new CTest tests. See clamav/unit_tests/CMakeLists.txt and clamav/examples/CMakeLists.txt for details. Feature Tests ClamAV primarily has feature tests for ClamD and ClamScan, though basic version tests do exist for FreshClam and SigTool as well. See clamav/unit_tests/CMakeLists.txt and clamav/unit_tests/clamscan_test.py for an example.
